#include <iostream>
#include <iomanip>
using namespace std;

// User-defined function to convert Fahrenheit to Celsius
double toCelsius(double fahrenheit) {
    return (fahrenheit - 32) * 5.0 / 9.0;
}

int main() {
    double F;
    cin >> F;

    double C = toCelsius(F);

    cout << fixed << setprecision(2);
    cout << F << " F is " << C << " C" << endl;

}

